import Link from "next/link";

export default () => (
  <header>
    <nav className="wrapper">
      <div className="logo">
        <Link href="/">
          <a>
            <h1>Killerpedia</h1>
          </a>
        </Link>
      </div>
      <ul>
        <li>
          <Link href="/">
            <a>Male killers</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>Female killers</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>Country</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>Serial Killers</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>Mass murderers</a>
          </Link>
        </li>
      </ul>
      <style jsx>{`
        nav {
          padding: 1rem 0;
          // display: flex;
          // flex-direction: column;
          text-transform: capitalise;
          border-bottom: 2px solid #09478a;
        }

        ul {
          margin: 0;
          padding: 0;
          display: flex;
          list-style: none;
        }

        li {
          margin-right: 1rem;
        }

        a {
          font-weight: 300;
          font-size: 14px;
          color: inherit;
          text-decoration: none;
          transition: all 0.2s;
          padding: 0.5rem 0.1rem;
          letter-spacing: 1px;
        }

        a:hover {
          color: white;
        }

        span {
          margin-right: 1rem;
        }

        .logo {
          flex: 1;
        }

        h1 {
          font-size: 2.2rem;
          color: white;
          margin: 4px 0;
          font-weight: 500;
          display: inline-block;
          font-family: "Merriweather", serif;
        }
      `}</style>
    </nav>
  </header>
);
